CREATE DATABASE domiyi_dbp;

USE domiyi_dbp;

CREATE TABLE users(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    email VARCHAR(50) NOT NULL,
    password VARCHAR(15) NOT NULL,
    name VARCHAR(40) NOT NULL,
    type VARCHAR(20) NOT NULL
);

CREATE TABLE orders(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idCompany BIGINT NOT NULL,
    idUser BIGINT NOT NULL,
    idTransaction BIGINT NOT NULL,
    date TIMESTAMP NOT NULL,
    career VARCHAR(10) NOT NULL,
    street VARCHAR(10) NOT NULL,
    homeNumber VARCHAR(15) NOT NULL
);

CREATE TABLE products(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idCompany BIGINT NOT NULL,
    idStatus BIGINT NOT NULL,
    name VARCHAR(80) NOT NULL,
    description TEXT,
    price DOUBLE NOT NULL,
    image VARCHAR(80),
    category INT,
    updated TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE transactions(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    paymentMethod VARCHAR(25) NOT NULL,
    status VARCHAR(10) NOT NULL
);

CREATE TABLE companiesStatus(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    status VARCHAR(25) NOT NULL
);

CREATE TABLE productsStatus(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    status VARCHAR(25) NOT NULL
);

CREATE TABLE details(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idOrder BIGINT NOT NULL,
    idProduct BIGINT NOT NULL,
    quantity BIGINT NOT NULL,
    observation TEXT
);

CREATE TABLE companies(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idStatus BIGINT NOT NULL,
    name VARCHAR(80) NOT NULL,
    image VARCHAR(100),
    idAdmin BIGINT NOT NULL,
    category INT,
    deliveryCost DOUBLE NOT NULL,
    officceHours VARCHAR(150) NOT NULL
);

CREATE TABLE stores(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idCompany BIGINT NOT NULL,
    career VARCHAR(10) NOT NULL,
    street VARCHAR(10) NOT NULL,
    storeNumber VARCHAR(10) NOT NULL,
    phone VARCHAR(20) NOT NULL,
    email VARCHAR(50) NOT NULL
);

CREATE TABLE offers(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idProduct BIGINT NOT NULL,
    price DOUBLE NOT NULL,
    CONSTRAINT fk_product FOREIGN KEY (idProduct) REFERENCES products(id)
    );

ALTER TABLE orders
    ADD CONSTRAINT fk_user FOREIGN KEY(idUser) REFERENCES users(id),
    ADD CONSTRAINT fk_company FOREIGN KEY(idCompany) REFERENCES companies(id),
    ADD CONSTRAINT fk_transaction FOREIGN KEY(idTransaction) REFERENCES transactions(id);

ALTER TABLE products
     ADD CONSTRAINT fk_pro_status FOREIGN KEY (idStatus) REFERENCES productsStatus(id),
     ADD CONSTRAINT fk_companies FOREIGN KEY (idCompany) REFERENCES companies(id);

ALTER TABLE details
    ADD CONSTRAINT fk_order FOREIGN KEY (idOrder) REFERENCES orders(id);


ALTER TABLE companies
    ADD CONSTRAINT fk_status FOREIGN KEY (idStatus) REFERENCES companiesStatus(id);

ALTER TABLE stores
    ADD CONSTRAINT fk_to_company FOREIGN KEY (idCompany) REFERENCES companies(id);































































